export class Accidental {
    config;
    log;
    code;
    isCautionary;
    constructor(config, log, code, isCautionary) {
        this.config = config;
        this.log = log;
        this.code = code;
        this.isCautionary = isCautionary;
    }
    parse(voiceEntryCtx) {
        voiceEntryCtx.setActiveAccidental(this.code);
        return {
            type: 'accidental',
            code: this.code,
            isCautionary: this.isCautionary,
        };
    }
}
